import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <div className="footer-container">
      <div className="footer-background"></div>
      <div className="company-name">한울 주식회사</div>
      <div className="company-address">서울특별시 중구 필동로 1길 30 동국대학교</div>
    </div>
  );
}

export default Footer;
